import './Header.css'
// import Image from 'src/Data/Arrow2.svg'

const Header = () => {
    return (
        <header className={'Header'}>
            <h1 id={'Title'}>와플고등학교 명단 관리 프로그램</h1>
        </header>
    )
}

export default Header
